import React, { Component } from 'react';
import './view/css/bootstrap.css';
import './view/css/main.css';
import './view/css/font-awesome.css';

class App extends Component {

  handleClick = () =>{
    this.props.history.push("./Member");
  };
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div className="col-3" >
            <h1 className="display-4">Welcome <i className="fa fa-smile-o" aria-hidden="true"></i></h1>
            <input type="text" className="form-control form-rounded text-center" placeholder="What's your name" />
            <br/>
            <p className="h6">Click below to join the game.<i className="fa fa-gamepad" aria-hidden="true"></i> </p>
            <button type="button" className="col-6 btn btn-info form-rounded" onPress={this.handleClick}>Join</button>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
